import React from 'react';
import Home from './Home';
import About from './About';
import Blog from './Blog';
import './App.css'
import{Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom';
import Form from './Form';
import './Form.css'
function App(){
  return(

<Router>
<section id="nav">
<a>HariCharan</a>
<a><Link to='/Home' style={{textDecoration:'none',color:'black',marginLeft:'450px',fontSize:'20px'}}>Science</Link></a>
<a id='a3'><Link to='/About' style={{textDecoration:'none',color:'black',marginLeft:'30px',fontSize:'20px'}}>Technology</Link></a>
<a id='a4'><Link to='/Blog' style={{textDecoration:'none',color:'black',marginLeft:'30px',fontSize:'20px'}}>History</Link></a>
<br></br>
<Switch>
  <Route path="/Home" component={Home}/>
  <Route path="/About" exact component={About}/>
  <Route path="/Blog" component={Blog}/>
</Switch>
</section>
<div>
  <Form />
</div>
</Router>

  );
  }
export default App;
